export default {
    viewNews:
        {   id:1,
            title_introduce:'15 Xu Hướng Thiết Kế Nội Thất Mới Nhất',
            content_introduce:'Bạn đã sẵn sàng để đón nhận những thứ sẽ trở thành xu hướng thiết kế nội thất trong năm sau và nhiều nhiều năm sau nữa?Một năm mới lại tới với những sự khởi đầu mới, tại sao không bắt đầu từ ngay trong chính căn nhà của bạn? Khi nhắc đến những chất liệu và thiết kế là xu hướng của các năm trước, chắc chắn những chuyên gia, stylish không chỉ về nội thất mà còn là designer, kiến trúc sư, decorator là những người hiểu rõ hơn ai hết.Chắc chắn, những hình ảnh trong bài viết này sẽ làm bạn “choáng ngợp” và cảm thấy có chút gì đó “ao ước” được sở hữu một căn nhà có thiết kế nội thất như vậy. Không chần chừ gì nữa, chúng ta cùng khám phá ngay:',
            desciption:[
                {
                    title:'1. Sử dụng màu sắc tối cho nhà bếp',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/xu_huong_thiet_ke_noi_that.jpg',
                    content:'Xu hướng sử dụng các màu sắc tối cho căn bếp của gia đình, chủ yếu hai màu đen và màu xanh navy đang ngày càng trở nên nổi tiếng hơn bao giờ hết, minh chứng là chỉ trong vòng 6 tháng qua, lượt tìm kiếm về các đồ nội thất trong bếp sử dụng 2 màu sắc này đã tăng tới 93%.Có thể khẳng định rằng, sắc xanh navy đang dần chiếm ưu thế trên những mảng tường, sàn nhà, căn bếp, thay thế dần cho màu xám cổ điển vẫn được ưa chuộng.',
                },
                {
                    title:'2. Sử dụng các chòm sao trang trí',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/su_dung_cac_chom_sao_trang_tri.jpg',
                    content:'Các nhà thiết kế nội thất đã lấy cảm hứng từ bầu trời, thiên văn học, mô hình các cung hoàng đạo, chòm sao và áp dụng chúng vào trang trí nội thất cho căn nhà của bạn. Xu hướng này thể hiện sự tinh tế, phóng khoáng và chút gì đó khá mơ mộng.Những mảng tường ốp đá được trang trí bằng sao gợi cảm giác vô cùng sang trọng và cầu kì.',
                },
                {
                    title:'3. Xu hướng sử dụng hình mẫu của đại dương',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/xu_huong_su_dung_hinh_mau_dai_duong.jpg',
                    content:'Các chuyên gia về thiết kế nội thất gọi đây là hiệu ứng “hành tinh xanh – Blue Planet” bởi lẽ nguồn cảm hứng từ những vật thể dưới đại dương tạo ra sự sống động cho trính căn nhà của bạn.Ví dụ dưới đây là những chiếc ghế bành được làm dưới hình dạng của vỏ sò điệp, đem lại cảm giác mượt mà, và tươi trẻ.',
                },
                {
                    title:'4. Phong cách Crittal',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/phong_cach_crittall.jpg',
                    content:'Không thể phủ nhận 1 điều rằng, phong cách “Crittal” đang dần được ưa thích trở lại khi nhắc tới xu hướng thiết kế nội thất. Chúng xuất hiện ở cửa sổ, cửa ra vào, tường nhà, và cả vách ngăn phòng nữa.Sắc sảo và linh hoạt là những gì chúng ta cảm nhận được, các nét mỏng nhưng không hề tạo cảm giác dễ vỡ. Không có gì lạ khi xu hướng thiết kế nội thất này đã thống trị trên mạng xã hội Pinterest suốt 1 thời gian dài. “Crittal” có khả năng biến đổi hoàn toàn một không gian bất kì, đem lại cảm giác mới mẻ, hiện đại, thân thiện và tràn ngập ánh sáng.Các ô cửa nội thất được thiết kế khéo léo, chủ yếu bằng kính và khung kim loại trong suốt, khi mở hay đóng đều không hề ảnh hưởng đến ánh sáng và không gian.',
                },
                {
                    title:'5. Xu hướng nội thất màu Nude',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/xu_huong_noi_that_mau_nude.jpg',
                    content:'Xu hướng thiết kế nội thất này đem lại cảm giác về sự trung tính và tràn đấy ấm áp. Trong một vài năm trở lại đây, màu xám đã thống trị các bảng màu trung tính, thế nhưng, màu của “cát” đã dần trở lại thay thế cho sự “u tối và nhàm chán” đã quá quen thuộc.',
                },
                {
                    title:'6. Tone màu Caramel – Mật ong',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/tone_mau_caramel_mat_ong.jpg',
                    content:'Khi lần đầu biết đến xu hướng chọn lựa nội thất mang tone màu này, lập tức nó đã đem lại những sắc thái của mùa thu ấm áp và dịu ngọt. Đây sẽ là một ấn tượng tuyệt vời khi kết hợp chúng với các căn phòng khách hoặc phòng ăn, nơi sum họp của gia đình.',
                },
                {
                    title:'7. Nhà tắm chất liệu bê tông',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/nha_tam_chat_lieu_be_tong.jpg',
                    content:'Xu hướng phong cách “bê tông” ngày càng trở thành những lựa chọn hàng đầu khi chọn lựa các vật liệu nội thất cho phòng tắm. Một bề mặt thô, tiện dụng, đem lại cảm giác mạnh mẽ và vô cùng đặc biệt. Mặc dù cảm giác thô, nhưng không hề đánh mất đi tính linh hoạt trong các tiện ích khi sử dụng.',
                },
                {
                    title:'8. 1950s',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/xu_huong_1950s.jpg',
                    content:'Trong khi vô vàn các phong cách thiết kế nội thất khác đã dần trở nên lỗi thời, 1950s bằng 1 cách thần kì nào đó vẫn còn giữ được độ “hot”. Bạn có thể dễ dàng bắt gặp kiểu dáng của thế kỉ trước ở mọi nơi, khách sạn, nhà hàng, biệt thự,Sự cổ điển nhưng không hề cổ lỗ, trái lại còn có nét hiện đại phảng phất trong các vật liệu được thiết kế theo xu hướng này.',
                },
                {
                    title:'9. Velvet – Vải nhung, mịn màng',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/velvet_vai_nhung_min_mang.jpg',
                    content:'Nhu cầu tìm kiếm các thiết kế nội thất đem lại cảm giác mịn màng, đã tăng gấp 4 lần trong vòng 6 tháng qua, chủ yếu là tìm kiếm các đồ dùng được làm bằng vải nhung. Vô cùng quyến rũ là những gì đem lại từ phong cách này, từ giường nhung, sofa nhung,…',
                },
                {
                    title:'10. Xu hướng nội thất du mục',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/xu_huong_noi_that_du_muc.jpg',
                    content:'Bạn nghĩ rằng xu hướng nội thất này chỉ nằm ở những sa mạc xa xôi của bộ lạc người da đỏ? Ngày càng có những đồ trang trí được thiết kế theo phong cách này để sử dụng trong căn nhà của bạn. Một nét rất riêng mà chỉ có xu hướng này đem lại.',
                },
                {
                    title:'11. Tường phòng khách hiện đại',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/tuong_phong_khach_hien_dai.jpg',
                    content:'Xu hướng sử dụng các chất liệu hiện đại, thân thiện làm mảng miếng trong thiết kế nội thất của phòng khách tiếp tục phát triển. Dễ dàng nhận ra chúng xuất hiện tại các thiết kế của khách sạn, nhà hàng, các không gian lớn, quán café,... Bởi lẽ việc áp dụng phong này thiết kế này sẽ tạo ra được những điều thần kì, đem lại cảm giác “open” cho những không gian nhỏ và chật hẹp.',
                },
                {
                    title:'12. Khăn trải giường màu đá',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/khan_trai_giuong_mau_da.jpg',
                    content:'Bộ khăn trải giường này tạo cảm giác vừa trang nhã vừa thoải mái và hiện đại; nhìn thấy thôi ngay lập tức đã liên tưởng tới sự ấm áp vào mùa đông, chỉ muốn ở mãi trên chiếc giường này thôi.',
                },
                {
                    title:'13. Trang trí họa tiết cho bát đĩa',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/trang_tri_hoa_tiet_cho_bat_dia.jpg',
                    content:'Những tấm sứ xinh xắn xứng đáng nhận được sự chú ý – chúng sẽ tạo ra những điểm nhấn lớn khi bạn tổ chức những bữa tiệc tại nhà cùng bạn bè hay người thân đấy.',
                },
                {
                    title:'14. FRIDA KAHLO',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/xu_huong_thiet_ke_noi_that_frida_kahlo.jpg',
                    content:'Khám phá xu hướng trang trí nội thất theo phong cách Mexico đầy màu sắc, với các tông màu nổi bật đan xen, tạo lên sức sống mãnh liệt cho không gian.',
                },
                {
                    title:'15. ALOHA',
                    img:'https://storage.googleapis.com/cdn.nhanh.vn/store2/64461/artCT/57752/xu_huong_thiet_ke_noi_that_aloha.jpg',
                    content:'Xu hướng thiết kế nội thất theo phong cách miền nhiệt đới của quần đảo Hawaii.Ví dụ về họa tiết trang trí thuê trên vỏ gối,những màu sắc nổi bật của miền nhiệt đới làm con người ta trở nên lạc quan, vui tươi hơn trong cuộc sống mưu sinh nhiều bộn bề.',
                },
                // {
                //     title:'',
                //     img:'',
                //     content:'',
                // },
            ]
        },
}
